import React from "react";

function SummerRefresh() {
  return (
    <div>
      <button className="absolute top-5 left-10 bg-red-600 p-3 rounded-2xl">
        Back
      </button>
      <iframe
        className="w-full h-screen"
        src="/projects/build/index.html"
      ></iframe>
    </div>
  );
}

export default SummerRefresh;
